// üìÅ BRAMHAND/frontend/src/pages/Brahma.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useDropzone } from 'react-dropzone';
import Papa from 'papaparse';
import * as XLSX from 'xlsx';

export default function Brahma() {
  const navigate = useNavigate();
  const [fileData, setFileData] = useState([]);
  const [columns, setColumns] = useState([]);
  const [stats, setStats] = useState({ rows: 0, cols: 0, missing: 0 });

  const onDrop = (acceptedFiles) => {
    const file = acceptedFiles[0];
    const reader = new FileReader();

    if (file.name.endsWith('.csv')) {
      reader.onload = (e) => {
        const parsed = Papa.parse(e.target.result, { header: true });
        setFileData(parsed.data.slice(0, 5));
        setColumns(Object.keys(parsed.data[0]));
        calculateStats(parsed.data);
      };
      reader.readAsText(file);
    } else if (file.name.endsWith('.xlsx')) {
      reader.onload = (e) => {
        const workbook = XLSX.read(e.target.result, { type: 'binary' });
        const sheet = workbook.Sheets[workbook.SheetNames[0]];
        const jsonData = XLSX.utils.sheet_to_json(sheet);
        setFileData(jsonData.slice(0, 5));
        setColumns(Object.keys(jsonData[0]));
        calculateStats(jsonData);
      };
      reader.readAsBinaryString(file);
    } else if (file.name.endsWith('.json')) {
      reader.onload = (e) => {
        const jsonData = JSON.parse(e.target.result);
        setFileData(jsonData.slice(0, 5));
        setColumns(Object.keys(jsonData[0]));
        calculateStats(jsonData);
      };
      reader.readAsText(file);
    } else {
      alert('Unsupported file type! Please upload CSV, XLSX or JSON.');
    }
  };

  const calculateStats = (data) => {
    const rows = data.length;
    const cols = data[0] ? Object.keys(data[0]).length : 0;
    let missing = 0;
    data.forEach(row => {
      Object.values(row).forEach(val => {
        if (val === null || val === '' || val === undefined) missing++;
      });
    });
    setStats({ rows, cols, missing });
  };

  const { getRootProps, getInputProps, isDragActive } = useDropzone({ onDrop });

  return (
    <div className="min-h-screen bg-gradient-to-b from-[#0f0c29] via-[#302b63] to-[#0f0c29] flex flex-col items-center justify-center p-6 text-white">
      <h1 className="text-5xl font-bold mb-8 animate-pulse">ü™î Brahma's Chamber of Creation</h1>

      <div
        {...getRootProps()}
        className="w-full max-w-3xl p-10 border-4 border-dashed border-yellow-400 rounded-xl bg-[#1a1a2e] flex flex-col items-center justify-center cursor-pointer hover:bg-[#16213e] transition"
      >
        <input {...getInputProps()} />
        {isDragActive ? (
          <p className="text-lg">Drop your sacred file here... üìÇ</p>
        ) : (
          <p className="text-lg">Drag & drop a file here, or click to select (CSV, Excel, JSON)</p>
        )}
      </div>

      {fileData.length > 0 && (
        <div className="mt-10 w-full max-w-4xl">
          <h2 className="text-2xl font-semibold mb-4">üìú Preview of Your Karma Data:</h2>
          <div className="overflow-x-auto">
            <table className="min-w-full table-auto text-sm text-gray-300">
              <thead>
                <tr>
                  {columns.map((col, index) => (
                    <th key={index} className="border px-4 py-2">{col}</th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {fileData.map((row, rowIndex) => (
                  <tr key={rowIndex}>
                    {columns.map((col, colIndex) => (
                      <td key={colIndex} className="border px-4 py-2">
                        {row[col] !== undefined ? row[col] : '-'}
                      </td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          <div className="mt-6 space-y-2">
            <p>üßÆ Rows: {stats.rows}</p>
            <p>üìè Columns: {stats.cols}</p>
            <p>‚ö†Ô∏è Missing Values: {stats.missing}</p>
          </div>

          <button
            onClick={() => navigate('/vishnu')}
            className="mt-8 bg-yellow-400 hover:bg-yellow-500 text-black font-bold py-3 px-8 rounded-full transition transform hover:scale-105"
          >
            ‚ú® Begin Karma Purification ‚ú®
          </button>
        </div>
      )}
    </div>
  );
}
